function CIRCLE(t,i,s){this.x=t,this.y=i,this.r=s}function RECTANGLE(t,i,s,r){this.x=t,this.y=i,this.w=s,this.h=r}function dist(t,i,s,r){var n=t-s,h=i-r;return Math.sqrt(n*n+h*h)}function isNumber(){for(var t=0;t<arguments.length;t++){var i=arguments[t];if(!Number.isInteger(i))return!1}return!0}var HITBOX={RECTANGLE:function(t,i,s,r){return isNumber(t,i,s,r)?new RECTANGLE(t,i,s,r):null},CIRCLE:function(t,i,s){return isNumber(t,i,s)?new CIRCLE(t,i,s):null}};CIRCLE.prototype={setLocation:function(t,i){isNumber(t,i)&&(this.x=t,this.y=i)},setSize:function(t){isNumber(t)&&t>=0&&(this.r=t)},drawBorder:function(t){if(null!=t){var i=t.getContext("2d");i.fillStyle="#000000",i.beginPath(),i.arc(this.x,this.y,this.r,0,2*Math.PI),i.stroke()}},isContact:function(t){if(t instanceof CIRCLE)return dist(this.x,this.y,t.x,t.y)<=t.r+this.r;if(t instanceof RECTANGLE){var i={x:t.x,y:t.y,w:t.w+this.r,h:t.h+this.r};return this.x+this.r>i.x&&this.x<i.x+i.w&&this.y+this.r>i.y&&this.y<i.y+i.h}}},RECTANGLE.prototype={setLocation:function(t,i){isNumber(t,i)&&(this.x=t,this.y=i)},setSize:function(t,i){isNumber(t,i)&&t>=0&&i>=0&&(this.w=t,this.h=i)},drawBorder:function(t){if(null!=t){var i=t.getContext("2d");i.fillStyle="#000000",i.rect(this.x,this.y,this.w,this.h),i.stroke()}},isContact:function(t){if(t instanceof RECTANGLE)return this.x+this.w>=t.x&&t.x+t.w>=this.x&&this.y+this.h>=t.y&&t.y+t.h>=this.y;if(t instanceof CIRCLE){var i={x:this.x,y:this.y,w:this.w+t.r,h:this.h+t.r};return t.x+t.r>i.x&&t.x<i.x+i.w&&t.y+t.r>i.y&&t.y<i.y+i.h}}};